import * as React from 'react';
import {Card, Page} from '@shopify/polaris';

const ListUser: React.FC<any> = () => {
    return (
        <Page
            fullWidth
            title="List user"
            pagination={{
                hasPrevious: true,
                hasNext: true,
            }}
        >
            <Card title="Credit card" sectioned>
                <p>Credit card information</p>
            </Card>
        </Page>
    )
}

export default ListUser;
